import React from 'react';
import logo from './logo.svg';
import Webcam from "react-webcam";
import './App.css';


class ImageRow extends React.Component {

    constructor(props){
        super(props);
    }

    removeImage(inx) {
        this.props.onRemoveImage(inx)
    }


    render() {
        let images = this.props.images.map((imageSrc,inx) => {
            return <img onClick={this.removeImage} className="snap-shot" key={inx} src={imageSrc}/>
        });
        return (
            <div className="snap-shot-wrapper">
                {images}
            </div>
        );
    }
}

export default ImageRow;
